import React, { Component } from "react";
import Nav from "../Nav";
import image from "./images/oxfordgarden.jpg";

class About extends Component {
    render() {
        const divStyle = {
            color: "black",
            border: "2px white solid",
            borderRadius: "5px",
            background: "#ffffff80",
            fontFamily: "Arial, Helvetica, sans-serif",
            width: "50%",
            margins: "0 auto",
            display: "block"
        }

        const titleStyle = {
            fontSize: "1.2rem",
            borderBottom: "1px black solid",
            width: "70%"
        }

        return(
            <div>
                <Nav />
                <div style={divStyle}>
                    <div id='about-title' style={titleStyle}>
                        About Me
                    </div>
                    <div id='about-body'>
                        <div id="about-image">
                            <img src="./images/oxfordgarden.jpg" alt="oxford gardens" />
                        </div>
                        <div id="about-text">
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default About;
